import React from 'react'

function Products() {
    return (
        <div>
            <h1>Products Selling Page</h1>

            <ul>
                <li>Paints</li>
                <li>Shirts</li>
                <li>T-shirts</li>
            </ul>
        </div>
    )
}

export default Products;
